export default data => `
    mutation{
        createTrack(input : {
            palylist: ${data.playlist}
            title: ${data.title}
            source: ${data.source}
            sourceId: ${data.sourceId}
            quality: ${data.quality}
            duration: ${data.duration}
            thumbanil: ${data.thumbnail}
            position: ${data.position}
        }) {
            id
        }
    }
`
